"Change Set:		7424Graphics-ar.63Graphics-ar.63:UIManagerization. Replaces all the trivial references to PopUpMenu, SelectionMenu, CustomMenu, and FillInTheBlank.Graphics-ar.48:Addresses an interesting bug in [Multi]DisplayScanner. All stopConditions exept #endOfRun have lastIndex past the last character displayed. #endOfRun sets it *on* the character. If we display up until lastIndex then we will also display invisible characters like CR and tab. This problem should be fixed in the scanner (i.e., position lastIndex consistently) but I don't want to deal with the fallout right now so we keep the fix minimally invasive.Graphics-ar.49:Addresses an interesting bug in [Multi]DisplayScanner. All stopConditions exept #endOfRun have lastIndex past the last character displayed. #endOfRun sets it *on* the character. If we display up until lastIndex then we will also display invisible characters like CR and tab. This problem should be fixed in the scanner (i.e., position lastIndex consistently) but I don't want to deal with the fallout right now so we keep the fix minimally invasive.Graphics-ar.50:Allow non-portable fonts in Morphic font selection menu when TTFileDescription>>offerNonPortableFonts is enabled.Graphics-ar.51:Integrate a fix from Multilingual-Support-FromEToys.Graphics-ar.52:Add subfamily name 'Negrata' to the list of known styles of Truetype fonts.Graphics-jmv.53:Part of StrikeFont enhancements to support glyphs up to 32bpp, with anti aliasing.Graphics-jmv.54:Additional DejaVu StrikeFonts, sizes 7 and 12.Graphics-jmv.55:Fixes Display alpha channel for AA StrikeFonts.Graphics-jmv.56:Moves the double pass for AA StrikeFonts from GrafPort up to BitBlt.Graphics-ar.57:Removes the extra iVars from BitBlt again (pushed down into GrafPort) since they would cause WarpBlt primitives to fail. Sigh.Graphics-ar.58:Adds CompositionScanner>>computeDefaultLineHeight to compute the height of an empty string correctly from its attributes.Graphics-jmv.59:Moves dual pass for AA StrikeFonts back to BitBlt, without needing any new instvar (that would break WarpBlt). Enhanced a bit the spacing between glyphs.Graphics-jmv.60:Another round of small fixes for AA StrikeFonts.Graphics-jmv.61:When setting new fonts to use the underscore and caret glyphs, don't mess with older existing StrikeFonts.Graphics-jmv.62:And do run the install again!"!Object subclass: #BitBlt	instanceVariableNames: 'destForm sourceForm halftoneForm combinationRule destX destY width height sourceX sourceY clipX clipY clipWidth clipHeight colorMap'	classVariableNames: 'CachedFontColorMaps ColorConvertingMaps'	poolDictionaries: ''	category: 'Graphics-Primitives'!!StrikeFont methodsFor: 'building' stamp: 'jmv 10/18/2008 23:50'!setGlyphsDepthAtMost: aNumber	glyphs depth > aNumber ifTrue: [		glyphs _ glyphs asFormOfDepth: aNumber ]! !!StrikeFont class methodsFor: 'character shapes' stamp: 'jmv 3/27/2009 09:28'!makeControlCharsVisible	"	Make normally not visible characters, visible	StrikeFont makeControlCharsVisible	"	self allInstances do: [ :font | font makeControlCharsVisible ]! !!StrikeFont class methodsFor: 'character shapes' stamp: 'jmv 8/6/2009 14:31'!useUnderscoreIfOver1bpp	"Sets underscore and caret glyphs for chars 95 and 94. 	Only for enhanced StrikeFonts, i.e. those with glyphs of more than 1bpp.	ASCII standard glyphs"	"	StrikeFont useUnderscoreIfOver1bpp	"	self allInstances do: [ :font | font useUnderscoreIfOver1bpp ]! !!StrikeFont class methodsFor: 'dejaVu font data' stamp: 'jmv 8/5/2009 22:33'!dejaVuSansBoldOblique9Data	"Created using:	Clipboard default clipboardText:		((FileStream oldFileNamed: 'AAFonts\DejaVu Sans Bold Oblique 9.txt') contentsOfEntireFile substrings 			collect: [ :each | each asNumber]) asString	"	^#(9 11 3 0 3 8 14 24 33 45 56 59 65 71 78 87 91 97 100 107 117 127 137 147 157 167 177 187 197 207 211 216 226 236 245 252 264 275 285 295 306 315 324 335 346 352 360 371