the baseline."	^pointSize < 9		ifTrue: [descent-1]		ifFalse: [descent]! !!StrikeFont methodsFor: 'character shapes' stamp: 'jmv 3/26/2009 14:49'!useUnderscore	self characterToGlyphMap.	characterToGlyphMap at: 96 put: 129.	characterToGlyphMap at: 95 put: 128! !!StrikeFont class methodsFor: 'dejaVu font data' stamp: 'jmv 8/5/2009 22:34'!dejaVuSansBook12Data	"Created using:	Clipboard default clipboardText:		((FileStream oldFileNamed: 'AAFonts\DejaVu Sans Book 12.txt') contentsOfEntireFile substrings 			collect: [ :each | each asNumber]) asString	"	^#(12 15 4 0 4 7 13 25 34 49 61 64 69 74 82 93 97 102 105 112 122 132 142 152 162 172 182 192 202 212 215 219 230 241 252 260 275 287 296 306 317 326 334 346 357 360 365 375 384 396 407 419 428 440 450 459 470 481 493 509 520 531 541 546 553 558 566 579 583 592 602 610 620 630 637 647 656 659 664 673 676 690 699 709 719 729 736 744 750 759 768 781 790 800 808 815 818 825 836 846 857 866 874 887 897 907 917 927 937 947 957 967 977 987 997 1007 1017 1027 1037 1047 1057 1067 1077 1087 1097 1107 1117 1127 1137 1147 1157 1167 1171 1174 1183 1192 1203 1213 1222 1230 1238 1251 1258 1266 1278 1283 1296 1302 1308 1319 1325 1332 1343 1353 1363 1366 1374 1379 1386 1394 1411 1427 1438 1446 1458 1470 1482 1495 1507 1519 1535 1545 1554 1563 1572 1581 1585 1589 1594 1600 1613 1624 1636 1648 1660 1672 1684 1695 1707 1718 1729 1740 1751 1762 1771 1780 1789 1798 1807 1816 1825 1834 1849 1857 1867 1877 1887 1897 1902 1907 1914 1920 1929 1938 1948 1958 1968 1978 1987 1998 2008 2017 2026 2035 2044 2054 2064 2074)! !!StrikeFont class methodsFor: 'dejaVu font data' stamp: 'jmv 8/5/2009 22:34'!dejaVuSansBook7Form	"Created using:	Clipboard default clipboardText:	 	((ByteArray streamContents:[:s|			PNGReadWriter				putForm: (Form fromFileNamed: 'AAFonts\DejaVu Sans Book 7.bmp')				onStream: s]) asString base64Encoded)	"	^Form fromBinaryStream: ('iVBORw0KGgoAAAANSUhEUgAABaIAAAALCAYAAACNtvp/AAAy3klEQVR4XuV9B1BUWd7vVL36Xn3