ers would overlap, so we widen them all first.	"	| extraWidth newGlyphs newXTable x newX w extraOnLeft |  	extraOnLeft _ (self height-1-self ascent+4)//4 max: 0.	extraWidth _ ((self ascent-5+4)//4 max: 0) + extraOnLeft.	newGlyphs _ Form extent: (glyphs width + (maxAscii + 1 - minAscii*extraWidth)) @ glyphs height depth: glyphs depth.	newGlyphs fillWhite.	newXTable _ xTable copy.	"Copy glyphs into newGlyphs with room on left and right for overlap."	minAscii to: maxAscii+1 do:		[:ascii | x _ xTable at: ascii+1.  w _ (xTable at: ascii+2) - x.		newX _ newXTable at: ascii+1.		newGlyphs copy: ((newX + extraOnLeft) @ 0 extent: w @ glyphs height)			from: x @ 0 in: glyphs rule: Form over.		newXTable at: ascii+2 put: newX + w + extraWidth].			glyphs _ newGlyphs. 	xTable _ newXTable.	"Slide the bitmaps left and right for synthetic italic effect."	4 to: self ascent-1 by: 4 do:		[:y | 		"Slide ascenders right..."		glyphs copy: (1@0 extent: glyphs width @ (self ascent - y))			from: 0@0 in: glyphs rule: Form over].	self ascent to: self height-1 by: 4 do:		[:y | 		"Slide descenders left..."		glyphs copy: (0@y extent: glyphs width @ glyphs height)			from: 1@y in: glyphs rule: Form over].	self isSynthetic: true.	fallbackFont ifNotNil: [		fallbackFont _ fallbackFont emphasized: 2	].! !!StrikeFont methodsFor: 'emphasis' stamp: 'jmv 4/26/2008 14:12'!isSynthetic	^type = 3! !!StrikeFont class methodsFor: 'dejaVu font data' stamp: 'jmv 8/5/2009 22:33'!dejaVuSansBoldOblique12Form	"Created using:	Clipboard default clipboardText:	 	((ByteArray streamContents:[:s|			PNGReadWriter				putForm: (Form fromFileNamed: 'AAFonts\DejaVu Sans Bold Oblique 12.bmp')				onStream: s]) asString base64Encoded)	"	^Form fromBinaryStream: ('iVBORw0KGgoAAAANSUhEUgAACXwAAAATCAYAAAAp8Ve0AAB9+klEQVR4XuVdB0xTaxsmado0TQkECAQII4ywAmIQR9wa9x5x773nde/ruurFPa6498QtTpw4EBcucCAqgmWVUUYZ7fOf1dNz2tMy9Hr97Zf0z3/lO+s73/m+933e531eK8Dym+U3y2+W3yy/WX6z/Gb5zfKb5TfLb5bfLL9ZfrP8ZvnN8