ultTextStyle put: TextStyle default."	TextConstants at: #DefaultTextStyle put: (TextStyle named: self fontName).	#(ListParagraph PopUpMenu StandardSystemView) do:[:className|		Smalltalk at: className ifPresent:[:aClass| aClass initialize].	].! !!CharacterScanner methodsFor: 'scanning' stamp: 'sn 7/31/2009 15:03'!scanCharactersFrom: startIndex to: stopIndex in: sourceString rightX: rightX stopConditions: stops kern: kernDelta	| startEncoding selector |	(sourceString isByteString) ifTrue: [^ self basicScanCharactersFrom: startIndex to: stopIndex in: sourceString rightX: rightX stopConditions: stops kern: kernDelta.].	(sourceString isWideString) ifTrue: [		startIndex > stopIndex ifTrue: [lastIndex := stopIndex. ^ stops at: EndOfRun].		startEncoding :=  (sourceString at: startIndex) leadingChar.		selector := EncodedCharSet scanSelectorAt: startEncoding.		^ self perform: selector withArguments: (Array with: startIndex with: stopIndex with: sourceString with: rightX with: stopConditions with: kernDelta).	].		^ stops at: EndOfRun! !!StrikeFont class methodsFor: 'character shapes' stamp: 'jmv 3/26/2009 14:51'!makeLfInvisible	"	Make line feed characters invisible	StrikeFont makeLfInvisible	"	self allInstances do: [ :font | font makeLfInvisible ]! !!StrikeFont methodsFor: 'emphasis' stamp: 'jmv 8/3/2009 09:17'!makeCondensedGlyphs	"Make a condensed set of glyphs with same widths.	NOTE: this has been superceded by kerning -- should not get called"	| g newXTable x x1 w |	g _ glyphs deepCopy.	newXTable _ Array new: xTable size.	newXTable at: 1 put: (x _ xTable at: 1).	1 to: xTable size-1 do:		[:i | x1 _ xTable at: i.  w _ (xTable at: i+1) - x1.		w > 1 ifTrue: [w _ w-1].  "Shrink every character wider than 1"		g copy: (x@0 extent: w@g height) from: x1@0 in: glyphs rule: Form over.		newXTable at: i+1 put: (x _ x + w)].	xTable _ newXTable.	glyphs _ g.	self isSynthetic: true.	fallbackFont ifNotNil: [		fallbackFont emphasized: 8	]."(TextStyle default fontAt: 1) copy makeCondensedGlyphs	displayLine: 'The quick brown fox jumps over the lazy dog'	at: Sensor cursorPoint"! !!TextStyle class methodsFor: 'instance creation' stamp: 'ar 8/6/2009 18:36'!changeDefaultFontSizeBy: delta      "TextStyle changeDefaultFontSizeBy: 1"	"This sample method recreates the default textStyle, with font 1 being a size	larger than the smallest.  It then initializes most references in the system	as well, although most windows will have to beclosed and reopened to get the effect."	| allFonts |	allFonts := TextStyle default fontArray asSortedCollection: [:a :b | a height < b height].	TextConstants at: #DefaultTextStyle put:		(TextStyle fontArray: ((1 to: allFonts size) collect: [:i | allFonts atWrap: i+delta])).	#(ListParagraph PopUpMenu StandardSystemView) do:[:className|		Smalltalk at: className ifPresent:[:aClass| aClass initialize].	].! !!StrikeFont methodsFor: 'emphasis' stamp: 'jmv 3/20/2009 10:27'!derivativeFont: aStrikeFont at: index	| newDeriv |	(aStrikeFont isNil and: [ index = 0 ]) 		ifTrue: [derivativeFonts := nil. ^ self].	derivativeFonts ifNil: [derivativeFonts := Array new: 32].	derivativeFonts size < 32 ifTrue: [		newDeriv := Array new: 32.		newDeriv replaceFrom: 1 to: derivativeFonts size with: derivativeFonts.		derivativeFonts := newDeriv.	].	derivativeFonts at: index put: aStrikeFont.! !!Color class methodsFor: 'colormaps' stamp: 'jmv 8/2/2009 21:31'!computeIndexedColorConvertingMap: targetColor from: sourceDepth to: destDepth	| map f c |		map _ (IndexedColors copyFrom: 1 to: (1 bitShift: sourceDepth)) collect: [ :cc | 		f _ 1.0 - (cc red + cc green + cc blue / 3.0 ).		c _ targetColor notNil			ifTrue: [				destDepth = 32					ifTrue: [ targetColor * f alpha: f]					ifFalse: [ targetColor alphaMixed: f*1.5 with: Color white ]]			ifFalse: [ cc ].		destDepth = 32			ifTrue: [ c pixelValueForDepth: destDepth]			ifFalse: [				f = 0.0					ifTrue: [ 0 ]					ifFalse: [ c pixelValueForDepth: destDepth ]]].	map _ map as: Bitmap.	^map! !!StrikeFont class methodsFor: 'dejaVu font data' stamp: 'jmv 8/5/2009 22:35'!dejaVuSansBook9Form	"Created using:	Clipboard default clipboardText:	 	((ByteArray streamContents:[:s|			PNGReadWriter				putForm: (Form fromFileNamed: 'AAFonts\DejaVu Sans Book 9.bmp')				onStream: s]) asString base64Encoded)	"	^Form fromBinaryStream: ('iVBORw0KGgoAAAANSUhEUgAABnUAAAAOCAYAAAD5VJn9AABJ1klEQVR4XuVdB0xTaxu+yY035sYbiRAIEISgBGjDCjtsCFMEBQOIIO69t7j3xD1xK14nbnGBEycuXLhAZZZVRhmlpX3+75yW0tJBUfyv9/ZLGrHfOV/P+eb7vM87fgM0v2h+0fyi+UXzi+YXzS+aXzS/aH7R/KL5RfOL5hfNL1QRCnkovjwHAyevRuKg0TjwvkHzO+WfHhNeCdISB2LExMFI2JCFaoFQ8ztFSRGwziKGGYoDz9IwhOGLLTmN6vcztwg3Vo3A1CPvwFHSx0IhH+X31mPk5P14Wd2soL4Z7KxkzJy1CXtWTcPi1M+ob9MWr/A8pkaNx+7j2zFrWCwm7X2F2jbXcD8ko5/nZNwgbfX3no7MGvnn4X09gnBGBJJPz4ar63xkcX7+vGgquIjZMXNxhcWX73v2fawaOBZHPtRDIGx9FkHtS+wcOw0HMk5i/shVuFPe2m/CynSMcY/CoU8FuDjMA4PPFIFP7uW824dRCVvwolYAXtFFzBy0GOnkN/llt7Bi1CKk3kjGpEkH6H4aGL0NbwuuYqR7DI5+ber4+uJkYdWQSUg+vg0zh0Zj3K4XqFEw/oK6Dzg2JQZzLxeiSai8r4WCGrzYMQyD12einC9Ues3LPZMwYVMqjiwYhcVpBeAqaJOeK9ET6Wej5srEPdlyc6VlvrTME+m/f945IUBdzl4MDp6FawrmQss1nFfbEN1nAW6W8RXWVz1eh4HDduPZxyuYHz0Zqd+4St8tI0v1e3E/7UfCoO14Uy/8T54BN9fFw83cGKa2oZh94r3SPeq/fRbWoLigDA0/8d2p3yjMKwC7SaC5MoegHqyCYtTyf+059tvPargxZwv87cbidvU/0wFCfhHOjumLxLtsfNoTg/D1L8ERar7gp/lF84vmF80v/6VCnTW+2n/grx7mGHy+RIkwXYfs1b4w7P4n/jAdgZtVP34WCJvZeLhuAMKXZ6KyWdjuM/pZd87vdvRsFTZX4H5SNGwMekCLMUat9pU9K/f9LvR1nYA74t+W/r+q+zrz/TW//D/kp1LcWjkA9j110DN4i8z40WNuogNDZiCmHv+EBs2XqzS/aH7R/PKfBvQc5D1Mx523bFrBqk6pz0nBsp2PwW4swOV1G3GrlP/f6IuqmxjD6IEePcQfNWSKn1EE3Ap8yy1EzU9QstDK1+xdmLbmDkrZT7Ft6lpksgX/0rOcg5JvRahu5ID1rRBs7n9XMdfMuoThjhHYcWwGvPpsQU6j5ssmml/wU/YHLqcRzf8x2ZciaMsyt2Coey/o6hjAMmgWUnMbaEKSeueaF9sR4zUKp/OVE4XcghvYlXwTRVyhTLsladPg6TIUR/NkSSph4wfsjbGAaeByXEtfAk+nmXhYK7pXWHkDI50jsCttM8I8piBTCvM25e5HH7Mg7HxXi+JLo2FlP0tyX6f2SXMlHiQNwfAdionN1n22DBkLQjEg6RHYbfQBgrrX2DHADvaxe5DThmCj3nG0v+jdKGwl/Z412TsR32cW0op5