72! !!StrikeFont methodsFor: 'emphasis' stamp: 'jmv 4/26/2008 14:11'!isSynthetic: aBoolean	type _ aBoolean ifTrue: [3] ifFalse: [0]! !!BitBlt methodsFor: 'private' stamp: 'jmv 8/5/2009 22:26'!installStrikeFont: aStrikeFont foregroundColor: foregroundColor backgroundColor: backgroundColor	| lastSourceDepth targetColor |	sourceForm ifNotNil:[lastSourceDepth := sourceForm depth].	sourceForm := aStrikeFont glyphs.	"Ignore any halftone pattern since we use a color map approach here"	halftoneForm := nil.	sourceY := 0.	height := aStrikeFont height.	sourceForm depth = 1 ifTrue: [		self combinationRule: Form paint.		(colorMap notNil and:[lastSourceDepth = sourceForm depth]) ifFalse: [			"Set up color map for a different source depth (color font)"			"Uses caching for reasonable efficiency"			colorMap := self cachedFontColormapFrom: sourceForm depth to: destForm depth.			colorMap at: 1 put: (destForm pixelValueFor: backgroundColor)].		colorMap at: 2 put: (destForm pixelValueFor: foregroundColor).	]	ifFalse: [		(Preferences subPixelRenderFonts and: [ foregroundColor = Color black or: [ Preferences subPixelRenderColorFonts ]]) ifTrue: [			destForm depth > 8 ifTrue: [				"rgbMul is equivalent to component alpha blend if text is black (only faster, hehe)"				self combinationRule: 37.		"RGBMul"				(Preferences properAlphaForBlackText or: [ (foregroundColor = Color black) not ]) ifTrue: [					"rgbMul / rgbAdd IS component alpha blend for any color of text (neat trick, eh!!)"					"This colorMap is to be used on the second pass with rule 20 (rgbAdd)					See #displayString:from:to:at:strikeFont:kern:"					colorMap := self colorConvertingMap: foregroundColor from: sourceForm depth to: destForm depth keepSubPixelAA: true]]			ifFalse: [				self combinationRule: 25.		"Paint"				targetColor := foregroundColor = Color black ifFalse: [ foregroundColor ].				colorMap := self colorConvertingMap: targetColor from: sourceForm depth to: destForm depth keepSubPixelAA: true]		]		ifFalse: [			"Do not use rule 34 for 16bpp display. TTCFont uses it, but it builds a glyphs cache for each color used!!"			self combinationRule: (destForm depth = 32 ifTrue: [34 "alphaBlendScaled"] ifFalse: [25 "Paint"]).			colorMap := self colorConvertingMap: foregroundColor from: sourceForm depth to: destForm depth keepSubPixelAA: false		]	].! !!StrikeFont class methodsFor: 'dejaVu font data' stamp: 'jmv 8/5/2009 22:33'!dejaVuSansBoldOblique7Form	"Created using:	Clipboard default clipboardText:	 	((ByteArray streamContents:[:s|			PNGReadWriter				putForm: (Form fromFileNamed: 'AAFonts\DejaVu Sans Bold Oblique 7.bmp')				onStream: s]) asString base64Encoded)	"	^Form fromBinaryStream: ('iVBORw0KGgoAAAANSUhEUgAABl4AAAALCAYAAAAeJPBpAABCM0lEQVR4XuVdB0xUW9c1IZAJmclMBgIBQglgQAigwYKxoBhBsCEaFWzYe+/49FmeXewVu2IXu1ixoqgoiChFHXoZ2tBhKDPrP/dOuzMMRZ/+n983J+HFN/uWc0/da6+992kH6H7R/aL7RfeL7hfdL7pffqRIJRX4sNUbvVZEo1Qi1f0G0f2i+0X3i+4X3S+6X/7QIhE9Q8igAEwKDMDiKwLUtGHfllRmIyWzAg1iIZI+ZaJS9/f6Hyr1ORGY7jMSE0ePw7boYjRKf337NVak4/P3UjQ0lkOQkIziuv+ePpJKJSh5NBUeY8NxfXEv+J8QoO4H2khaL8STTZOw/E4u6rXcRz2/8stZLJy4GhGplZAwrqFlyRfx17wQ/DVrIrZEizTkDci+HoItEWcwp0dfhDwvUZNTpTphK4aM2oebOwIQsC8JtU3koZgYEo4zS4KxO7Hm987vyi84PXcqDn2qalJP2fdU48vBQIzeHY8KjXksldZD+GwXFi5eg6UT5+OCQKwhb0TutWD4LL2Bi9P6Y26Uqi2kUjFy7v2NSWujUNioeq6kPAHH50/BhjsCVMvfJylLwJmQ+QgJmYYpe96jXP67tPItVvmOx4mbazEo8BQEPzGGqxMOYEXYDewZ2QXDDiahppnxUJVyDgsn70FchaSFcVWA5zumYOaeF8gXS7XKX+5dhEWrl2HS3LP4VqvlmsoP2LXyBG6GDkOXkWFI1XaNpBCRVHtGRGBO/+m4Vyj5l/OpHlVlNWrrjFRShZTwBZiy72Oz63d9wXPsmDoLe18Km8y/+oKX2LtoEVYvnYh54d8h1pBLhHcx1Xs+Iq7MQv+ZD1GsbWw93YYps/cjWlj3G7BoDUryhSivk/zEvWKI8vMhEkt+2XpWGhuKgI6dMTYsCdW/Yb2XSupRWZCPourGVutSW5yDnOLaJusBtbZVFeajoKJe61rR7H4m+oaPn7LbpAdQ7xcXJON9vABlDdL/B5sE6Uuh8F/1JfWMUmE+imskf5CtpRbCpHgkF4qb7Suq3oXJ8UjMUV/7pZJKZH96j8Tc6h/q599Z2mn+UPkuBJ047TEjSoTa5L0Y6LMF0Y+XoPeIc8hiDBzx18MYNnQfvqRfxwTvELyr1LagFuPBkoW4I1R1oKQ6Fefn9oIV3xK9l95BDtlcJJUJ2D9qCDZobvoNBXgROhZdLTgw5NvBd3McK