VuSansOblique', point, 'Form') asSymbol)		data: (self perform: ('dejaVuSansOblique', point, 'Data') asSymbol)		name: 'Bitmap DejaVu Sans ', point, 'I')			emphasis: 2;			pointSize: pointSize.	boldOblique := (StrikeFont new		buildFromForm: (self perform: ('dejaVuSansBoldOblique', point, 'Form') asSymbol)		data: (self perform: ('dejaVuSansBoldOblique', point, 'Data') asSymbol)		name: 'Bitmap DejaVu Sans ', point, 'BI')			emphasis: 3;			pointSize: pointSize.			base derivativeFont: bold at: 1.	base derivativeFont: oblique at: 2.	base derivativeFont: boldOblique at: 3.		^base! !!StrikeFont class methodsFor: 'removing' stamp: 'jmv 3/31/2009 08:20'!limitTo16Bits	"Limit glyph depth to 16 bits (it is usually 16 or 32).		StrikeFont limitTo16Bits	"	StrikeFont allInstances do: [ :f | f		setGlyphsDepthAtMost: 16 ].! !!StrikeFont class methodsFor: 'dejaVu font data' stamp: 'jmv 8/5/2009 22:36'!dejaVuSansOblique9Data	"Created using:	Clipboard default clipboardText:		((FileStream oldFileNamed: 'AAFonts\DejaVu Sans Oblique 9.txt') contentsOfEntireFile substrings 			collect: [ :each | each asNumber]) asString	"	^#(9 11 3 0 3 7 12 22 29 40 49 52 57 62 68 77 81 85 88 95 103 111 119 127 135 143 151 159 168 176 179 184 193 202 211 217 229 238 247 257 267 276 284 293 303 308 315 325 332 343 353 364 373 383 392 401 410 419 428 441 451 459 469 474 478 484 490 500 503 510 518 525 533 540 546 555 563 568 574 582 587 599 607 614 623 631 638 645 650 657 665 675 683 692 700 707 709 716 725 732 740 748 754 764 771 778 785 792 799 806 813 820 827 834 841 848 855 862 869 876 883 890 897 904 911 918 925 932 939 946 953 960 963 967 974 983 992 1000 1008 1015 1022 1032 1038 1045 1055 1059 1069 1074 1079 1088 1094 1100 1110 1119 1126 1128 1136 1141 1147 1154 1167 1180 1188 1195 1204 1213 1222 1231 1240 1249 1262 1272 1281 1290 1299 1308 1313 1318 1324 1330 1340 1350 1361 1372 1383 1394 1405 1413 1424 1433 1442 1451 1460 1468 1477 1485 1492 1499 1506 1513 1520 1527 1539 