[ 			Take fullpixel luminance level. Apply it to targetColor.			I.e. answer colors with NO subpixelAA ]"	| mask map c bitsPerColor r g b f v |	destDepth > 8		ifTrue: [bitsPerColor _ 5]  "retain maximum color resolution"		ifFalse: [bitsPerColor _ 4].	"Usually a bit less is enough, but make it configurable"	bitsPerColor _ bitsPerColor min: Preferences aaFontsColormapDepth.	mask _ (1 bitShift: bitsPerColor) - 1.	map _ Bitmap new: (1 bitShift: (3 * bitsPerColor)).	0 to: map size - 1 do: [:i |		r _ (i bitShift: 0 - (2 * bitsPerColor)) bitAnd: mask.		g _ (i bitShift: 0 - bitsPerColor) bitAnd: mask.		b _ (i bitShift: 0) bitAnd: mask.		f _ 1.0 - (r + g + b / 3.0 / mask).		c _ targetColor notNil			ifTrue: [				(keepSubPix and: [destDepth > 8]) ifTrue: [						Color							r: 1.0 - (r/mask) * targetColor red							g: 1.0 - (g/mask) * targetColor green							b: 1.0 - (b/mask) * targetColor blue ]				ifFalse: [					destDepth = 32						ifTrue: [ targetColor * f alpha: f ]						ifFalse: [ targetColor alphaMixed: f*1.5 with: Color white ]]]			ifFalse: [ Color r: r g: g b: b range: mask].		v _ destDepth = 32			ifTrue: [ c pixelValueForDepth: destDepth]			ifFalse: [				f < 0.1					ifTrue: [ 0 ]					ifFalse: [ c pixelValueForDepth: destDepth ]].		map at: i + 1 put: v ].	^ map! !!StrikeFont methodsFor: 'character shapes' stamp: 'jmv 3/27/2009 09:19'!makeLfVisible	| glyph |	self characterToGlyphMap.	glyph _ self characterFormAt: (Character value: 163).	glyph border: glyph boundingBox width: 1 fillColor: Color blue."	glyph _ glyph reverse."	self characterFormAt: (Character value: 132) put: glyph.	characterToGlyphMap at: 11 put: 132! !!StrikeFont class methodsFor: 'font creation' stamp: 'jmv 8/6/2009 14:24'!installDejaVu	"Warning: Uses the methods in 'dejaVu font data' category, that will be removed soon (or are already removed) to save space.""StrikeFont installDejaVu"	TextConstants at: 'Bitmap DejaVu Sans' put: (TextStyle fontArray: