ame. pt}}.			item checked: (active and:[pt = priorFont pointSize]).		].		style isTTCStyle ifTrue: [			ptMenu add: 'new size'				target: style 				selector: #addNewFontSizeDialog: 				argumentList: {{fontName. fontMenu}}.		].		item := fontMenu add: fontName action: nil.		item subMenu: ptMenu.		item checked: active.	].	TTFileDescription offerNonPortableFonts ifTrue:[		fontMenu addSeparator.		item := fontMenu add: 'More (non-portable) Fonts...' 			target: resultBlock 			selector: #value:			argumentList: #(TTFileDescription).	].	widget := builder open: fontMenu.	builder runModal: widget.	result ifNil:[^nil].	"Pick a non-portable font if requested"	result == #TTFileDescription ifTrue:[		^Smalltalk at: #TTFileDescription ifPresent:[:ttf| 			ttf fontFromUser: priorFont allowKeyboard: aBoolean]].	style := TextStyle named: result first.	style ifNil: [^ self].	font := style fonts detect: [:any | any pointSize = result last] ifNone: [nil].	^ font! !!BitBlt class methodsFor: 'private' stamp: 'jmv 8/2/2009 21:37'!recreateColorMaps	CachedFontColorMaps _ ColorConvertingMaps _ nil! !!DisplayScanner methodsFor: 'scanning' stamp: 'ar 7/30/2009 22:13'!displayLine: textLine offset: offset leftInRun: leftInRun	"The call on the primitive (scanCharactersFrom:to:in:rightX:) will be interrupted according to an array of stop conditions passed to the scanner at which time the code to handle the stop condition is run and the call on the primitive continued until a stop condition returns true (which means the line has terminated).  leftInRun is the # of characters left to scan in the current run; when 0, it is time to call setStopConditions."	| done stopCondition nowLeftInRun startIndex string lastPos |	line := textLine.	morphicOffset := offset.	lineY := line top + offset y.	lineHeight := line lineHeight.	rightMargin := line rightMargin + offset x.	lastIndex := line first.	leftInRun <= 0 ifTrue: [self setStopConditions].	leftMargin := (line leftMarginForAlignment: alignment) + offset x.	destX := runX := leftMargin.	fillBlt == nil ifFalse:		["Not right"		fillBlt destX: line left destY: lineY			width: line width left height: lineHeight; copyBits].	lastIndex := line first.	leftInRun <= 0		ifTrue: [nowLeftInRun := text runLengthFor: lastIndex]		ifFalse: [nowLeftInRun := leftInRun].	destY := lineY + line baseline - font ascent.	runStopIndex := lastIndex + (nowLeftInRun - 1) min: line last.	spaceCount := 0.	done := false.	string := text string.	[done] whileFalse:[		startIndex := lastIndex.		lastPos := destX@destY.		stopCondition := self scanCharactersFrom: lastIndex to: runStopIndex						in: string rightX: rightMargin stopConditions: stopConditions						kern: kern.		lastIndex >= startIndex ifTrue:[			font displayString: string on: bitBlt 				from: startIndex 	"XXXX: The following is an interesting bug. All stopConditions exept #endOfRun		have lastIndex past the last character displayed. #endOfRun sets it *on* the character.		If we display up until lastIndex then we will also display invisible characters like		CR and tab. This problem should be fixed in the scanner (i.e., position lastIndex		consistently) but I don't want to deal with the fallout right now so we keep the		fix minimally invasive."				to: (stopCondition == #endOfRun ifTrue:[lastIndex] ifFalse:[lastIndex-1]) 				at: lastPos kern: kern].		"see setStopConditions for stopping conditions for displaying."		done := self perform: stopCondition.		lastIndex > runStopIndex ifTrue: [done := true].	].	^ runStopIndex - lastIndex   "Number of characters remaining in the current run"! !!StrikeFont class methodsFor: 'dejaVu font data' stamp: 'jmv 8/5/2009 22:34'!dejaVuSansBook12Form	"Created using:	Clipboard default clipboardText:	 	((ByteArray streamContents:[:s|			PNGReadWriter				putForm: (Form fromFileNamed: 'AAFonts\DejaVu Sans Book 12.bmp')				onStream: s]) asString base64Encoded)	"	^Form fromBinaryStream: ('iVBORw